import './App.css';
import Header from './Components/Header';
import Footer from './Components/Footer';
import { useState } from "react";
import navbar from './Components/navbar';

function App() {

  //Hook
  const [servicios, agregarServicios] = useState(
    [
      {id:1 , nombre:"Macalma", Precio:2500, AnioLanzamiento:2015 ,link:"/disco-macalma" },
      {id:2 , nombre:"Colores de la oscuridad", Precio:2500, AnioLanzamiento:2018 ,link:"/disco-Colores-de-la-oscuridad"},
      {id:3 , nombre:"nuevo Disco", Precio:2500, AnioLanzamiento:2023 ,link:"/disco-nuevo-Disco"}
   ]
  ); 

  const redSocial = 'FEISBU'
  return (
    <div className='dark container-fluid'>
       <Header/>
       <navbar/>
      {
        servicios.map(servicio => (
          <a href={servicio.link} > <p> Ver disco: {servicio.nombre}</p> </a>
        ))
      }

      <Footer
        redSocial={redSocial}
      />
    </div>
  );
}

export default App;
